import React from 'react'
import './footer.css'
import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap'
import logo from '../../assets/images/logo.png'

const Footer = () => {

  const quick__links = [
    {
      path: '/home',
      display: 'Home'
    },
    {
      path: '/about',
      display: 'About'
    },
    {
      path: '/tours',
      display: 'Tours'
    }
  ]
  const quick__links2 = [
    {
      path: '/gallery',
      display: 'Gallery'
    },
    {
      path: '/login',
      display: 'Login'
    },
    {
      path: '/register',
      display: 'Register'
    }
  ]
  return (
    <footer>
      <Container>
        <Row>
          <Col lg=''>
            <div>
              <img/>
            </div>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
